script.code:
console.log("context is",ctx);
if(ctx.hasItem('pointystick')) {
  ctx.customDialog(['The box is empty.'],'chest');
} else {
  ctx.receiveItem('pointystick');
  ctx.customDialog(['You found a pointy stick. Lucky you. ','Engage in glorious battle, brave one!'],'pointystick');
}

ctx.customBattle('bigrat').then((status)=>{
   console.log('battle over, status is',status);
  if(status == ctx.BattleCalcs.CONSTS.WON) {
     ctx.item('bigrat').hide()
   }
})
